3tW7RT7XlrH5tq76hMIqTrqWhxF+ArS9bfiGnH4Hw/Mcm0hmH+3fcr7PRquenZwg7Uds8K4MG89NJLJZWAJP8AAAAAPM5+8OPW5/550EHshrPZqRc7O9Xb+0rFtfRWWn++cUNra6taW1s7gOiwe/kpytbTngGgmmd+2lz1+ueff75j8m969uO9DAkAAAAAHjmHrgIwvZXW/Pwnmp//5KBDAQA84qj8AwAAAIBDvAYgAAAAAAAAgJ0dugpA1Js5TQxW7owMAAAAAACAvUEFIAAAAAAAAFDHSAACAAAAAAAAdYwEIAAAAAAAAFDH/s//3PnbQccAAAAAAAAAYB88daxJ/x9Zbln0hYyy/AAAAABJRU5ErkJggg==\&quot;\n    }\n]&quot;,&quot;code&quot;:&quot;// We use the `cy.get()` command to get all elements that match the selector.\n// Then, we use `should` to assert that there are two matched items,\n// which are the two default items.\ncy.get(&#x27;.todo-list li&#x27;).should(&#x27;have.length&#x27;, 3);\n// We can go even further and check that the default todos each contain\n// the correct text. We use the `first` and `last` functions\n// to get just the first and last matched elements individually,\n// and then perform an assertion with `should`.\ncy.get(&#x27;.todo-list li&#x27;).first().should(&#x27;have.text&#x27;, &#x27;Pay electric bill&#x27;);\ncy.get(&#x27;.todo-list li&#x27;).last().should(&#x27;have.text&#x27;, &#x27;Walk the dog&#x27;);&quot;,&quot;err&quot;:{&quot;message&quot;:&quot;AssertionError: Timed out retrying after 10000ms: Not enough elements found. Found &#x27;2&#x27;, expected &#x27;3&#x27;.&quot;,&quot;estack&quot;:&quot;AssertionError: Timed out retrying after 10000ms: Not enough elements found. Found &#x27;2&#x27;, expected &#x27;3&#x27;.\n    at Context.eval (webpack:///./cypress/e2e/todo.cy.ts:24:0)&quot;,&quot;diff&quot;:&quot;- 2\n+ 3\n&quot;},&quot;uuid&quot;:&quot;f14fd0c1-9d73-428c-843a-bdd9f412ddbc&quot;,&quot;parentUUID&quot;:&quot;a531ab4b-58cd-4030-a078-b16e9a95258a&quot;,&quot;isHook&quot;:false,&quot;skipped&quot;:false},{&quot;title&quot;:&quot;can add new todo items&quot;,&quot;fullTitle&quot;:&quot;example to-do app can add new todo items&quot;,&quot;timedOut&quot;:null,&quot;duration&quot;:1171,&quot;state&quot;:&quot;passed&quot;,&quot;speed&quot;:&quot;fa
